import { Link } from "react-router-dom"
const DUMMY_EVENTS = [
    {
        id:'e1',
        title:"some venet"    
    },
    {
        id:"e2",
        title: "Another event"
    }
]



export default function  EventsPage() {
    return <h1>
        <>
            <h1>Events Page</h1>
            <ul>
                {DUMMY_EVENTS.map(event => <li key={event.id}>

                    <Link to={`/events/${event.id}`}>

                    </Link>

                    </li>)

                }
            </ul>
        </>
    </h1>
}
